import React from 'react';
import PropTypes from 'prop-types';
import "./InputText.scss";
InputText.propTypes = {};

function InputText(props) {
  return (
    <div className="InputText">
      <input type="text" name="name" placeholder="Họ và Tên" />
    </div>
  );
}


export default InputText;
